import React, { useEffect, useState } from 'react';
import { withRouter } from 'next/router';
import { useSelector, useDispatch } from 'react-redux';
import { Col, Row, Typography, Button, Form, Input } from 'antd';
import { } from '@ant-design/icons';

const Details = (props) => {
    const [filled, setFilled] = useState(true);
    let data;
    if (props.router.query.data) {
        data = props.router.query.data.split(",");
        console.log(data);
    }else{
        console.log("어디서 사기치려고하니?");
    }
    const [form] = Form.useForm();
    return (
        <div style={{ width: '430px', margin: "0 auto", border: "1px solid #dadce0", borderRadius: "8px", padding:"30px 10px" }}>
            <Row gutter={[0, 16]}>
                <Col style={{ width: '100%', textAlign: "center" }}>
                    <Typography.Title level={3} style={{ color: "#202124" }}>구장 등록하기</Typography.Title>
                    <Typography style={{ color: "#202124", fontWeight: "normal" }}>구장 상세정보</Typography>
                </Col>
            </Row>
            <Row gutter={[0, 16]}>
                <Col span={22} offset={1}>
                    <Form 
                    layout="horizontal"
                    form={form}
                    initialValues={{location:data? data[2]:''}}
                    scrollToFirstError
                    >
                        <Form.Item
                        name="title"
                        label="구장명"
                        rules={[{required:true, message:"구장명을 입력하여주세요"}]}>
                            <Input placeholder="정식 구장명을 입력해주세요"/>
                        </Form.Item>
                        <Form.Item
                        name="location"
                        label="주소"
                        >
                            <Input disabled/>
                        </Form.Item>
                    </Form>
                </Col>
            </Row>
            <Row>
                <Col span={24} style={{textAlign:"center"}}>
                    <Button type="primary" shape="round" htmlType="button" disabled={filled}>다음단계</Button>
                </Col>
            </Row>
        </div>
    );
};

export default withRouter(Details);
